import { useState } from "react";
import getProductByBarcode from "../helpers/getProductByBarcode";


const Buy = () => {

    const [barcodeChecked, setBarcodeChecked] = useState(true);
    // console.log(barcodeChecked);

    return (
        <div className="mt-10 mb-2">
            <div className="flex flex-row-reverse justify-center">
                <input type="text" className="border ms-1 focus:outline-2 focus:outline-yellow-300" />
                <div className="flex">
                    <label className="flex items-center">
                        بالباركود
                        <input type="radio" checked={barcodeChecked}  onChange={() => setBarcodeChecked(!barcodeChecked)} />
                    </label>
                    <label className="flex align-center content-center">
                        بالإسم
                        <input type="radio" checked={!barcodeChecked} onChange={() => setBarcodeChecked(!barcodeChecked)} />
                    </label>
                </div>
                <button type="button" className="bg-main-color px-3 py-2 font-bold rounded-md ml-5">ابحث</button>
            </div>
        </div>
    );
}

export default Buy;
